import react from "react";
import { useGetFB} from "../Meta/use-fetch";
import images from "./FoodImages/index";


  
const FoodContext = react.createContext({
  FoodData: [],
});
const DB_URL = "https://react-s16-http-request-default-rtdb.asia-southeast1.firebasedatabase.app/"


export const FoodContextProvider = (props) => {

  const [getFoods] = useGetFB(DB_URL)
  
  let FoodData = {
    1001: {
      
      img: images["1001"],
    },
    1002: {
      
      img: images["1002"],
    },
    1003: {
      
      img: images["1002"],
    },
    2001: {
      
      img: images["1002"],
    },
    2002: {
      
      img: images["1002"],
    },
    3001: {
      
      img: images["1002"],
    },
    3002: {
      
      img: images["1002"],
    },
    3003: {
      
      img: images["1002"],
    },
  
    //Method to filter the object by its row
    filterByRow: function (selectedRow) {
      let filtered = {};
      for (const key in this) {
        if (this[key].row === selectedRow) {
          filtered[key] = this[key];
        }
      }
      return filtered;
    },
  };
  
  const recievedFood = getFoods()
  console.log(recievedFood)

  console.log("ASDASD")
  return (
    <FoodContext.Provider
      value={{
        FoodData: FoodData,
      }}
    >
      {props.children}
    </FoodContext.Provider>
  );
};

export default FoodContext;
